import React, { useState, useEffect } from 'react';

function App() {
    const [data, setData] = useState<string[][]>([]);

    useEffect(() => {
        const url = 'https://docs.google.com/spreadsheets/d/e/2PACX-1vTMx94V7eSHtqjJaH1Hn5kIbMKdUq-KTjDQ4-ekoZIDtWDncLZ87AHjYoLJxPBqcCYTB6eWOA6nX_Fg/pub?output=csv';

        fetch(url)
            .then(response => response.text())
            .then(csvData => {
                const rows = csvData.split('\n').map(row => row.split(','));
                setData(rows);
            })
            .catch(error => {
                console.log(error);
            });
    }, []);

    return (
        <div>
            <h1>Donn√©es de ma feuille Google Sheets</h1>
            <table>
                <thead>
                <tr>
                    {data.length > 0 && data[0].map((header, index) => (
                        <th key={index}>{header}</th>
                    ))}
                </tr>
                </thead>
                <tbody>
                {data.slice(1).map((row, index) => (
                    <tr key={index}>
                        {row.map((cell, index) => (
                            <td key={index}>{cell}</td>
                        ))}
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
}

export default App;
